import React from "react";
import "../style/Footer.css";

const Footer = () => {
  return (
    <>
      <div className='footer-container'>
        <div className='footer-logo'>plantarrium</div>

        <div className='-container'>
          <div className='-label'>Shop All Plants</div>
          <div className='-label'>Large Plants</div>
          <div className='-label'>Medium Plants</div>
          <div className='-label'>Small Plants</div>
        </div>
      </div>
    </>
  );
};

export default Footer;
